import React from 'react';
import './App.css';
import axios from 'axios';


function login() {
  const data = {
    UAM_EMAIL: this.email,
    UAM_PASSWORD: this.password,
  }

  axios.post('http://niche.kmsj13.com/User_accounts/loginThruCredentials', data)
    .then(res => {
      console.log(res)
    })
    .catch(err => {
      console.log(err)
    });
}

function App() {
  return (
    <form onSubmit={this.handleSubmit}>

      <h3>LOGIN</h3>

      <div>
        <label>Email</label>
        <input type="email" placeholder="email" onChange={e => this.email = e.target.value} />
      </div>

      <div>
        <label>Password</label>
        <input type="password" placeholder="password" onChange={e => this.password = e.target.value} />
      </div>

      <button onClick="login()">Log in</button>

    </form>
  );
}

export default App;
